// @ts-nocheck
import React from 'react';
import styled from 'styled-components';

const MiniSeatView = ({ seatCoordinates, seat, mini = true }) => {
  if (!seat) return null;

  return (
    <ViewContainer mini={mini}>
      <SeatInfoContainer>
        <SeatHeader>
          <SeatTitle>Seat Information</SeatTitle>
          <SeatId>{seat.id}</SeatId>
        </SeatHeader>

        <SeatDetails>
          <SeatDetail>
            <DetailLabel>Section</DetailLabel>
            <DetailValue>{seat.section}</DetailValue>
          </SeatDetail>
          <SeatDetail>
            <DetailLabel>Row</DetailLabel>
            <DetailValue>{seat.row}</DetailValue>
          </SeatDetail>
          <SeatDetail>
            <DetailLabel>Seat</DetailLabel>
            <DetailValue>{seat.number}</DetailValue>
          </SeatDetail>
          <SeatDetail>
            <DetailLabel>Price</DetailLabel>
            <DetailValue>${seat.price}</DetailValue>
          </SeatDetail>
        </SeatDetails>

        <SeatLocation>
          <LocationDiagram>
            <StadiumOutline />
            <SeatIndicator 
              section={seat.section}
              row={seat.row}
              number={seat.number}
            />
          </LocationDiagram>
          <LocationText>Your seat location</LocationText>
        </SeatLocation>
      </SeatInfoContainer>
    </ViewContainer>
  );
};

const ViewContainer = styled.div`
  height: ${props => props.mini ? '100%' : '100%'};
  width: 100%;
  position: relative;
  background-color: #f5f5f5;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const SeatInfoContainer = styled.div`
  width: 100%;
  height: 100%;
  padding: 20px;
  display: flex;
  flex-direction: column;
`;

const SeatHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 20px;
`;

const SeatTitle = styled.h3`
  margin: 0;
  font-size: 18px;
  font-weight: 600;
  color: #333;
`;

const SeatId = styled.div`
  background-color: #1976d2;
  color: white;
  padding: 4px 12px;
  border-radius: 20px;
  font-size: 14px;
  font-weight: 600;
`;

const SeatDetails = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 15px;
  margin-bottom: 20px;
`;

const SeatDetail = styled.div`
  display: flex;
  flex-direction: column;
`;

const DetailLabel = styled.span`
  font-size: 12px;
  color: #666;
  margin-bottom: 4px;
`;

const DetailValue = styled.span`
  font-size: 16px;
  font-weight: 600;
  color: #333;
`;

const SeatLocation = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

const LocationDiagram = styled.div`
  position: relative;
  width: 200px;
  height: 120px;
  margin-bottom: 10px;
`;

const StadiumOutline = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  border: 2px solid #000;
  border-radius: 60px;

  &::after {
    content: '';
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    width: 80px;
    height: 40px;
    border: 2px solid #000;
    border-radius: 50%;
  }
`;

const SeatIndicator = styled.div`
  position: absolute;
  width: 12px;
  height: 12px;
  background-color: #1976d2;
  border-radius: 50%;
  top: ${props => `calc(30% + ${(props.row - 1) * 20}px)`};
  left: ${props => props.section === 'A' 
    ? `calc(25% + ${(props.number - 1) * 15}px)` 
    : `calc(65% + ${(props.number - 1) * 15}px)`};
  transform: scale(1.5);
  box-shadow: 0 0 0 3px rgba(25, 118, 210, 0.3);
`;

const LocationText = styled.p`
  font-size: 14px;
  color: #666;
  margin: 0;
  text-align: center;
`;

export default MiniSeatView;
